import React, { useState } from "react";
import Selectors from "../components/Selector";

const Home = () => {
  return (
    <div className="wrapper">
      <header>
        <h1>BBOKJIIIIII</h1>
        <h2>나만을 위한 복지검색</h2>
      </header>

      <Selectors />

      <section className="search-container">
        <button onClick="getData()">
          <h4>결과보기</h4>
        </button>
        <button onClick="clearAll()">
          <h4>초기화</h4>
        </button>
      </section>
    </div>
  );
};

export default Home;
